import React from 'react';
import LoginForm from './LoginRegister/LoginForm';
import './App.css';
import GoogleButton from 'react-google-button'

function App() {
  return (
    <div className="app">

      <div className="left">
      <h4>Welcome back</h4>
      <h6>Login to continue documenting</h6>
      <GoogleButton
  onClick={() => { console.log('Google button clicked') }}
/>
        <LoginForm />
      </div>
      <div className="right">
        <div className="logo">
          <img src="your-logo-image-link" alt="Logo" />
        </div>
        <div className="text">
          Your text here
        </div>
      </div>
    </div>
  );
}

export default App;
